        {
            try
            {
                
                StreamReader srFaultyGestures = new StreamReader(mPathFaultyGestures);

                string faultyId;
                while(!srFaultyGestures.EndOfStream)
                {
                    faultyId = srFaultyGestures.ReadLine();
